import React from 'react';
import Axios from 'axios';

class StockList extends React.Component{
    constructor(props) {
        super(props);
        this.state={
            stocks : [],
            errorMsg:''
        }
    }

    componentDidMount(){
        this.getAllStocks();
    }

    getAllStocks = async() => {
        try{
            let stockUrl='https://gist.githubusercontent.com/Meghesha/69698775d6ef19598745d3776af9906d/raw/85e46840a6325fdb6dac80270c9ae9d35c6d09ae/Stocks-19-01-2023';
            let resource = await Axios.get(stockUrl);
            this.setState({
                ...this.state,
                stocks : resource.data
            })
        } catch(error){
            this.setsState({
                ...this.state,
                errorMsg : error
            })
        };
    }

    render() {
        return (
            <React.Fragment>
                <section className="p-3">
                    <div className="container">
                        <div className="row">
                            <div className="col">
                                <div className="card">
                                    <div className="card-header">
                                        <p className="h2 text-secondary">Stocks List</p>
                                        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Est fugit, iste labore numquam quae dolore ducimus veniam rerum alias quibusdam.</p>
                                    </div>
                                </div>
                                <table className="table table-striped table-hover text-center">
                                    <thead className="bg-secondary text-white">
                                        <tr>
                                            <th>SID</th>
                                            <th>Stock Name</th>
                                            <th>Stock Industry</th>
                                            <th>Stock Sector</th>
                                            <th>Market_cap</th>
                                            <th>Symbol</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {
                                            this.state.stocks.length > 0 ?
                                            <React.Fragment>
                                                {
                                                    this.state.stocks.map(stock =>{
                                                        return(
                                                            <tr key={stock.id}>
                                                                <td>{stock.id}</td>
                                                                <td>{stock.name}</td>
                                                                <td>{stock.industry}</td>
                                                                <td>{stock.sector}</td>
                                                                <td>{stock.market_cap}</td>
                                                                <td>{stock.symbol}</td>
                                                            </tr>
                                                        )
                                                    })
                                                }
                                            </React.Fragment> : null
                                        }
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    </div>
                </section>

            </React.Fragment>
        );
    }
};
export default StockList;
